window.bookSummaryJSON = "<p><b>Self-obsessed. Arrogant. Jerk. I mean...what sensible man would have nothing but a towel wrapped around his waist in his </b><b><i>own </i></b><b>office?</b></p> <p>And what sensible girl can avoid all those naughty thoughts then?</p> <p>He's in his 40s - old enough to be my father.</p> <p>OMG...those green eyes that I want to drown myself into, that smooth voice when he orders me around, and don't even get me started on the muscles...and those hard abs I saw that day in his office...oooh lord! Have mercy! Because I am compelled to...call him daddy!</p> <p>He says, \"Age brings in experience,\" and I am so ready to surrender my V-card.</p> <p>We are going great, but then he decides to change things. I can't! I can't allow him to ruin my career.</p> <p>So what...if I am head over heels in love with him and the baby in my belly is his!</p> <p><b>Contains mature themes.</b></p>"; 
